claircore/libvuln/driver/Updater type Updater interface { Name() string Fetcher Parser
} An Updater implementation is responsible for fetching a security advisory database and parsing the contents. An Updater is an aggregate interface consisting of. claircore/libvuln/driver/Fetcher claircore/libvuln/driver/Parser type Fingerprint string type Fetcher interface { Fetch(context.Context, Fingerprint) (io.ReadCloser, Fingerprint, error)
} A Fetcher implementation is responsible for returning an io.ReadCloser where the contents of a security database can be read from. A Fingerprint is provided so the implementation can determine if the security database needs to be fetched. For example the Fingerprint maybe a sha-256 hash of the contents. See source for mode details. type Parser interface { Parse(ctx context.Context, contents io.ReadCloser) ([]*claircore.Vulnerability, error)
} The reason we split fetching and parsing is to easily support offline modes of operation. A parser can be provided any io.ReadCloser allowing for simple scripts to be implemented for on demand parsing and indexing of CVE data. In order to run your updater on an interval and as part of the claircore runtime you must implement both methods.

