claircore/libvuln/driver/Matcher type Matcher interface { Name() string Filter(record *claircore.IndexRecord) bool Query() []MatchConstraint Vulnerable(record *claircore.IndexRecord, vuln *claircore.Vulnerability) bool
} A Matcher implementation is responsible for telling ClairCore which packages to query via the Filter method, how to query the security advisory database via the Query method and whether the discovered Vulnerability from the security advisory database affects the provided package via the Vulnerable method. See implementations for further details. A Matcher implementation should exist next to a Updater implementation to share this information between the two. A Matcher informs ClairCore how to query the security advisory database by returning a list of MatchConstraint. A MatchContraint constrains a query to the security advisory database by the provided values. Multiple MatchConstraint will be 'AND'd together. type MatchConstraint int const ( _ MatchConstraint = iota DistributionDID DistributionName DistributionVersion DistributionVersionCodeName DistributionVersionID DistributionArch DistributionCPE DistributionPrettyName
) As an example the Ubuntu Updater parses and indexes vulnerabilities and populates the Vulnerability.Distribution.DID, Vulnerability.Distribution.Name, and Vulnerability.Distribution.Version fields. The Ubuntu Matcher is aware of this and constrains it's queries by returning DistributionDID,DistributionName, DistributionVersion, constraints when it's Query method is called. ClairCore will query the security advisory database with these constraints returning only applicable vulnerabilities.
